style.css:
@-moz-document domain("youtube.com") {
/* Set background color, font, and text color for the whole page */
    body {
        background-color: #FFDBE0 !important;
        font-family: 'Laura', sans-serif !important;
        color: #54350D !important;
    }

    /* Customize subscribe button */
    .yt-subscribe-button, .yt-options-renderer-button {
        background-color: #FF91A4 !important;
        color: #FFFFFF !important; /* White text color */
        font-family: 'Laura', sans-serif !important;
    }
}
